Назначение:

Цифровая автоматическая телефонная станция (ЦАТС) «МиниКом DX-500С» представляет собой транзитно-оконечную АТС с автономным распределенным управлением, предназначенную для работы в сети специальной телефонной связи.

Отдельные станции могут работать на разных уровнях иерархии сети, исполняя функции: 
- оконечной станции, обеспечивающей соединение абонент-абонент и абонент-СЛ; 
- транзитной станции, обеспечивающей соединение СЛ-СЛ; 
- транзитно-оконечной станции.

